const emojipedia = [
  {
    id: 1,
    emoji: "💪",
    name: "Flexed Biceps",
    description:
      "“You can do that!” or “I feel strong!” Arm with tense biceps. Also used in connection with doing sports, e.g. at the gym."
  },
];

export default emojipedia;
